import Vue from 'vue'
import nprogress from 'nprogress'
import Home from './Home.vue'
import Navbar from './Navbar.vue'
import Page from './Page.vue'
import Sidebar from './Sidebar.vue'
import sidebarMap from './SidebarMap.vue'
import { resolveSidebarItems, pathToComponentName } from './util'
import './icons/font/flaticon.css'
import CodeFund from './CodeFound'
import Carbon from './Carbon'
export default {
    components: { Home, Page, Sidebar, Navbar, CodeFund, Carbon, sidebarMap },
    data() {
        return {
            isSidebarOpen: false,
            currentMetaTags: []
        }
    },

    computed: {
        shouldShowNavbar() {
            const { themeConfig } = this.$site
            const { frontmatter } = this.$page
            if (frontmatter.navbar === false) return false
            return (
                this.$title ||
                themeConfig.logo ||
                themeConfig.repo ||
                themeConfig.nav ||
                this.$themeLocaleConfig.nav
            )
        },
        shouldShowSidebar() {
            const { themeConfig } = this.$site
            const { frontmatter } = this.$page
            return (
                !frontmatter.layout &&
                !frontmatter.home &&
                frontmatter.sidebar !== false &&
                this.sidebarItems.length
            )
        },
        sidebarItems() {
            return resolveSidebarItems(
                this.$page,
                this.$page.regularPath,
                this.$site,
                this.$localePath
            )
        },
        sortComponents() {
            return this.sidebarItems

            // return this.sidebarItems.map((items) => {
            //   if(items.title == 'Components') {
            //     items.children = items.children.sort((a, b) => a.title.localeCompare(b.title))
            //   }
            //   return items
            // })
        },
        pageClasses() {
            const userPageClass = this.$page.frontmatter.pageClass
            return [
                {
                    'no-navbar': !this.shouldShowNavbar,
                    'sidebar-open': this.isSidebarOpen,
                    'no-sidebar': !this.shouldShowSidebar
                },
                userPageClass
            ]
        }
    },

    created() {
        if (this.$ssrContext) {
            this.$ssrContext.title = this.$title
            this.$ssrContext.lang = this.$lang
            this.$ssrContext.description = this.$page.description || this.$description
        }
    },

    mounted() {
        // update title / meta tags
        // this.currentMetaTags = []
        // const updateMeta = () => {
        //   document.documentElement.lang = this.$lang
        //   const meta = [
        //     {
        //       name: 'description',
        //       content: this.$description
        //     },
        //     ...(this.$page.frontmatter.meta || [])
        //   ]
        //   this.currentMetaTags = updateMetaTags(meta, this.currentMetaTags)
        // }
        // this.$watch('$page', updateMeta)
        // updateMeta()

        // configure progress bar
        // nprogress.configure({ showSpinner: false })

        // this.$router.beforeEach((to, from, next) => {
        //   if (to.path !== from.path && !Vue.component(pathToComponentName(to.path))) {
        //     nprogress.start()
        //   }
        //   next()
        // })

        this.$router.afterEach(() => {
            // nprogress.done()
            this.isSidebarOpen = false
        })
    },

    beforeDestroy() {
        updateMetaTags(null, this.currentMetaTags)
    },

    methods: {
        toggleSidebar(to) {
            this.isSidebarOpen = typeof to === 'boolean' ? to : !this.isSidebarOpen
        },
        // side swipe
        onTouchStart(e) {
            this.touchStart = {
                x: e.changedTouches[0].clientX,
                y: e.changedTouches[0].clientY
            }
        },
        onTouchEnd(e) {
            const dx = e.changedTouches[0].clientX - this.touchStart.x
            const dy = e.changedTouches[0].clientY - this.touchStart.y
            if (Math.abs(dx) > Math.abs(dy) && Math.abs(dx) > 40) {
                if (dx > 0 && this.touchStart.x <= 80) {
                    this.toggleSidebar(true)
                } else {
                    this.toggleSidebar(false)
                }
            }
        }
    }
}

function updateMetaTags(meta, current) {
    if (current) {
        current.forEach(c => {
            document.head.removeChild(c)
        })
    }
    if (meta) {
        return meta.map(m => {
            const tag = document.createElement('meta')
            Object.keys(m).forEach(key => {
                tag.setAttribute(key, m[key])
            })
            document.head.appendChild(tag)
            return tag
        })
    }
}
